import React from 'react';
import { Tabs } from 'antd';

const items = new Array(3).fill(null).map((_, i) => {
    const id = String(i + 1);
    return {
        label: `Tab ${id}`,
        key: id,
        children: `Content of tab ${id} `,
    };
});


const TabsSwitcher = () => {
    return (
        <>
            <Tabs items={items} />
        </>
    );
};
export default TabsSwitcher;
